import React from "react";
import SingleMovie from "./SingelMovie";
const App = () => {
     return;
     <>
          <BrowserRouter>
               <Routes>
                    <Route path='/' element={<Home />} />
                    <Route path='movie/:id' element={<SingleMovie />} />
               </Routes>
          </BrowserRouter>
     </>;
};

export default App;
